import { Component } from "react";

class Contact extends Component {
  constructor(props) {
    super(props);
    this.state = {
        data: []
    };
  }

  componentDidMount() {
      fetch('http://127.0.0.1:8000/api/data-guru')
      .then(response => response.json())
      .then(data => this.setState({data: data.data}));
  }

  render() {
    return (
        <div>
            <h1>Contact US</h1>
            <p>Lets Contact Us</p>
            <table className="table">
                <thead>
                    <tr>
                        <th>No</th>
                        <th>Nama</th>
                        <th>Jurusan</th>
                        <th>Ruangan</th>
                    </tr>
                    {this.state.data.map((item, index) => (
                        <tr key={index}>
                            <td>{index + 1}</td>
                            <td>{item.name}</td>
                            <td>{item.major}</td>
                            <td>{item.major}</td>
                        </tr>
                    ))}
                </thead>
            </table>
        </div>
    );
  }
}

export default Contact;
